// dummyPosts.js
export const dummyPosts = [
    {
      id: 1,
      title: "파리 워킹홀리데이 후기",
      author: "재혁",
      date: "2024. 4. 1. 0:00",
      content: "파리에서의 워킹홀리데이 경험을 공유합니다. 에펠탑 근처에서 일하면서 프랑스 문화를 체험했습니다. 현지 사람들과 교류하며 언어 실력도 크게 향상되었습니다.",
      likes: 10,
      comments: [
        { id: 1, author: "user1", content: "좋은 글이네요! 저도 가보고 싶어요." },
        { id: 2, author: "user2", content: "프랑스 워홀 준비 중인데 많은 도움이 됐습니다." }
      ]
    },
    {
      id: 2,
      title: "호주 시드니 생활 6개월 차",
      author: "민지",
      date: "2024. 3. 15. 14:30",
      content: "호주 시드니에서 6개월째 생활 중입니다. 멋진 해변과 다양한 문화를 경험하고 있어요. 영어 실력도 많이 늘었고, 새로운 친구들도 많이 사귀었습니다.",
      likes: 15,
      comments: [
        { id: 1, author: "user3", content: "호주 날씨는 어떤가요?" },
        { id: 2, author: "user4", content: "시드니 물가가 궁금해요!" }
