    },
    {
      id: 3,
      title: "캐나다 밴쿠버 워홀 준비 팁",
      author: "수진",
      date: "2024. 2. 28. 09:45",
      content: "캐나다 밴쿠버로 워홀을 준비하면서 알게 된 팁들을 공유합니다. 비자 신청부터 현지 숙소 구하기, 직장 찾기까지 자세히 설명해드릴게요.",
